void cnn::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"cnn_input_address0\" :  \"" << cnn_input_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"cnn_input_ce0\" :  \"" << cnn_input_ce0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"cnn_input_q0\" :  \"" << cnn_input_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"prediction_output_address0\" :  \"" << prediction_output_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"prediction_output_ce0\" :  \"" << prediction_output_ce0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"prediction_output_we0\" :  \"" << prediction_output_we0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"prediction_output_d0\" :  \"" << prediction_output_d0.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

